  //   .then(r => r.json())
  //   .then(resp => {
  //     if(resp == undefined){
  //       return 'No se encontró el pais'
  //     } else return resp;
  //   })
  // }
  return (
    <div className="App">
      <Route
      exact
      path='/'
      component={Loading}
      />
      <Route 
      path='/home'
      component={Nav}
      />
      <Route 
      exact
      path='/home'
      component= {Home}
      />
      <Route
        path="/country/:id"
        render={({ match }) => {
          return <CountryDetails id={match.params.id} />;
        }}
      />
      <Route 
      path='/createdActivity'
      component= {activity}
      />
    </div>
  );
}

export default App;
